import "./Home.scss";

function Home() {
  return (
    <div className="home">
      <div className="home__image">
        <h1 className="home__about-us">About Us</h1>
      </div>
      <div className="home__bottom">
        <p className="home__paragraph">
          Straycats have very short lives around 3 ~ 5 years. Being homeless,
          foodless, not knowing where the next meal comes from, not always in
          good health. They are forced to bear the crises emerging from around.
          Each cat is a unique living life, they deserve to have a shelter with
          loving owners.{" "}
        </p>

        <p className="home__paragraph">
          You can bring your favorite cat home, with following conditions met.{" "}
        </p>

        <ul className="home__condition home__paragraph">
          <li>You love cats</li>
          <li>Your family agree to raise a cat</li>
          <li>You promise to take good care of your cat </li>
          <li>You promise never to abandon your cat</li>
        </ul>
      </div>
      <button className="home__list">Meow List</button>
    </div>
  );
}
export default Home;
